import React from "react";
import "./People.css";
import Header from "./Header";
import { SearchInput } from "evergreen-ui";

function People() {
    const searchbox = {
        border: "solid 1.5px #707070",
        borderRadius: "5px",
        marginLeft: "200px",
    };
    return (
        <div>
            <Header />
            <div className="people">
                <SearchInput width={850} height={45} style={searchbox} />
            </div>
        </div>
    );
}

export default People;
